    static void downloadMraidJs(final Context context, final String s) {
        if (!TextUtils.isEmpty((CharSequence)s)) {
            Utils.ThreadUtils.execute(new Runnable() {
                @Override
                public void run() {
                    try {
                        MMSDK.Log.w("MMJS -  download start (" + s + ")");
                        final HttpResponse execute = new DefaultHttpClient().execute((HttpUriRequest)new HttpGet(s));
                        MMSDK.Log.w("MMJS -  download finish (" + s + ")");
                        if (MRaid.saveMRaid(context, execute.getEntity().getContent())) {
                            if (MRaid.storeMraidUrl(context, s)) {
                                MMSDK.Log.w("MMJS -  download saved (" + s + ")");
                            }
                            if (MRaid.finishedRef != null) {
                                final Finished finished = MRaid.finishedRef.get();
                                if (finished != null) {
                                    finished.finished();
                                }
                            }
                        }
                    }
                    catch (MalformedURLException ex) {
                        ex.printStackTrace();
                    }
                    catch (IllegalStateException ex2) {
                        ex2.printStackTrace();
                    }
                    catch (IOException ex3) {
                        ex3.printStackTrace();
                    }
                }
            });
        }
    }
    
